import React from "./node_modules/react";
import { Link } from "./node_modules/react-router-dom";

const CreateButton = () => {
  return (
    <React.Fragment>
      <Link to="" className="btn btn-lg btn-info">
        Create a
      </Link>
    </React.Fragment>
  );
};

export default CreateButton;
